INSERT INTO `concepto_retiro` (`id_concepto`, `causalidad_retiro`, `concepto_retiro`, `fecha_retiro`, `numero_caja`, `fecha_registro`, `fecha_modificacion`, `usuarios_id_usuario`) VALUES
(1, 'VOLUNTARIO', 'Voluntario sin previo aviso por motivos de ÃƒÂ­ndole familiar que lo obligaron a desocupar su sitio de residencia de forma imprevista.  - Leidy Cristina Pulgarin Gallego', '2023-01-10', '1', '2023-01-30', NULL, 166),
(2, 'VOLUNTARIO', '', '2022-09-09', '1', '2023-01-30', NULL, 175),
(3, 'VOLUNTARIO', '', '2022-12-09', '1', '2023-01-30', NULL, 163),
(4, 'OTRA', 'Renuncia Voluntaria,  Se retirÃƒÂ³ unos dÃƒÂ­as antes de que le reconocieran la pensiÃƒÂ³n por vejez  debido a que tenÃƒÂ­a programado un viaje a Europa para visitar a sus 2 hijas que tuvieron bebe.\r\n\r\nSe destacÃƒÂ³ por su gran sentido de pertenecÃƒÂ­a y gratitud con la empresa, compromiso, responsabilidad, por ser muy colaborador, servicial y respetuoso con sus compaÃƒÂ±eros, siempre muy dispuesto a ayudar en la secciÃƒÂ³n que lo requerÃƒÂ­an. - Leidy Cristina Pulgarin Gallego', '2022-06-24', '37', '2023-03-14', NULL, 46),
(5, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Renuncia Voluntaria,  Se retirÃƒÂ³ unos dÃƒÂ­as antes de que le reconocieran la pensiÃƒÂ³n por vejez  debido a que se sentÃƒÂ­a muy enfermo y que mientras comienza a recibir la mesada pensional los hijos estarÃƒÂ¡n a cargo de los gastos de hogar. - Leidy Cristina Pulgarin Gallego', '2022-06-30', '37', '2023-03-14', NULL, 55),
(6, 'VOLUNTARIO', 'El trabajador desempaÃƒÂ±aba labores en la MÃƒÂ¡quina Enchapadora de Cantos, manifestÃƒÂ³ tener dolencia en las manos, sin haber sufrido un accidente en el trabajo y llevar menos de tres meses en la empresa, por lo que fue a la IPS Los Rosales diciendo que el dolor fue contraÃƒÂ­do en la empresa y empezÃƒÂ³ a diagnosticar todo como si fuera de origen laboral, abandonÃƒÂ³ su puesto, despuÃƒÂ©s de una incapacidad. DespuÃƒÂ©s de haber recibido un correo comunicÃƒÂ¡ndole que lo que estaba haciendo era abandono de puesto sin justificaciÃƒÂ³n alguna, se le realizarÃƒÂ­a terminaciÃƒÂ³n de contrato, volviÃƒÂ³ a la empresa solicitando una suma exagerada para que le reconocieran la supuesta enfermedad laboral que habÃƒÂ­a adquirido en el poco tiempo que manejÃƒÂ³ la enchapadora. Finalmente conciliaron un acuerdo y posteriormente renunciÃƒÂ³. - Leidy Cristina Pulgarin Gallego', '2022-06-10', '37', '2023-03-14', NULL, 51),
(7, 'VOLUNTARIO', 'Renuncia voluntaria por temas personales, se siente enfermo, con migraÃƒÂ±a y va a solicitar citas mÃƒÂ©dicas y a realizarse exÃƒÂ¡menes para revisar cual es el problema que tiene, que primero la salud, quiere descansar un poco debido a que mÃƒÂ¡s adelante su padre lo va ayudar para llevÃƒÂ¡rselo para Estados Unidos. El lÃƒÂ­der de tapicerÃƒÂ­a le llamÃƒÂ³ varias veces la atenciÃƒÂ³n en el terminado del tapizado debido a que dejo pasar varios muebles con problemas de calidad y los devolvieron de la Bodega Principal. - Leidy Cristina Pulgarin Gallego', '2022-05-31', '37', '2023-03-14', NULL, 87),
(8, 'VOLUNTARIO', 'Renuncia voluntaria, le iba muy bien en el proceso pero por la parte salarial no se acoplo, decÃƒÂ­a que no importaba que este fuera un trabajo estable y con todas sus prestaciones, que ÃƒÂ©l estaba enseÃƒÂ±ado a recibir mÃƒÂ¡s dinero y en otro lado le iban a pagar mucho mejor, su aspiraciÃƒÂ³n salarial era mÃƒÂ¡s de $1.600.000. - Leidy Cristina Pulgarin Gallego', '2022-07-05', '38', '2023-03-14', NULL, 190),
(9, 'VOLUNTARIO', 'Renuncia Voluntaria,  mejor oferta laboral de $1.500.000 en un molinero, estaba reubicado como pintor pero no le estaba yendo bien en el proceso. - Leidy Cristina Pulgarin Gallego', '2022-07-08', '38', '2023-03-14', NULL, 54),
(10, 'VIAJE A OTRO PAIS', 'Renuncia Voluntaria, tuvo un alto nivel de ausentismo, viaje a EE.UU. para vivir con la mamÃƒÂ¡. - Leidy Cristina Pulgarin Gallego - Leidy Cristina Pulgarin Gallego', '2022-07-15', '38', '2023-03-14', NULL, 72),
(11, 'VOLUNTARIO', 'Renuncia voluntaria, desea trabajar en lo que estudiÃƒÂ³, solicitÃƒÂ³ aumento de salario pero no fue autorizado, su situaciÃƒÂ³n familiar es muy compleja debido a que su padrastro esta en silla de ruedas y su hermana perdiÃƒÂ³ un ojo en un accidente y necesita viajar con ella a unos exÃƒÂ¡menes a IbaguÃƒÂ© para acompaÃƒÂ±arla, entonces tambiÃƒÂ©n requiere disponibilidad de tiempo para estos trÃƒÂ¡mites. Fue muy respetuosa y responsable con su trabajo. - Leidy Cristina Pulgarin Gallego', '2022-08-12', '38', '2023-03-14', NULL, 83),
(12, 'VOLUNTARIO', 'RenunciÃƒÂ³ por motivos personales, informo que se cambiÃƒÂ³ de ciudad que se fue a vivir a Armenia, faltÃƒÂ³ varios dÃƒÂ­as sin excusa, hasta que informo que se iba a retirar, fue necesario contactar a varios de sus familiares para enviarle la razÃƒÂ³n de que viniera a legalizar su renuncia, es muy irresponsable. - Leidy Cristina Pulgarin Gallego', '2022-08-31', '38', '2023-03-14', NULL, 198),
