(14, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Retiro Voluntario, se retiro 15 dÃƒÂ­as antes de recibir su primera mesada pensional, manifestando que debia realizar unos tramites de  caracter personal, fue muy respetuoso, se le llamÃƒÂ³ la atenciÃƒÂ³n debido a que estaba utilizando el celular en horario laboral en el baÃƒÂ±o, como tenÃƒÂ­a restricciones mÃƒÂ©dicas, las actividades que desempeÃƒÂ±aba en TapicerÃƒÂ­a eran muy basicas. ejm: armar esquineros. - Leidy Cristina Pulgarin Gallego\n\nDespuÃƒÂ©s de que se retiro estuvo realizando malos comentarios de la empresa, que aqui los querian tenerlos como esclavos con respecto a los tiempos que se les exigiian. ManifestÃƒÂ³ tambiÃƒÂ©n que varias personas que informaron entre ellas (Robinson Mena (TapicerÃƒÂ­a) - Bryan Loiaza (Maquinado). que se retiraban debido a que se iban del pais en realidad se fueron a trabajar en realidad a Audifarma que es donde trabaja su hijo. - Edith Betancourt Betancourt', '2022-09-15', '38', '2023-03-14', NULL, 57),
(15, 'VOLUNTARIO', 'Retiro voluntario, debido a que es cabeza de familia, tiene 2 hijos (15 y 4 aÃƒÂ±os) que dependen econÃƒÂ³micamente de ella, tiene a su ex-esposo demandando por alimentos y su madre quien le cuidaba el hijo menor de 4 aÃƒÂ±os, le informÃƒÂ³ que se va a ir varios meses para Chile,  entonces Liliana va a emprender un negocio desde su casa. \r\n\r\nSu desempeÃƒÂ±o fue muy bueno, es muy respetuosa y comprometida, le apasiona las mÃƒÂ¡quinas de coser, era la persona idÃƒÂ³nea para reparar servicios tÃƒÂ©cnicos o realizar trabajos especiales de costura, inclusive tiene un tatuaje en su cuerpo de una mÃƒÂ¡quina. La Ing. Viviana le informo que si su mamÃƒÂ¡ regresaba de Chile y estaba interesada en reingresar que le notificara. - Leidy Cristina Pulgarin Gallego\n\nFinalmente nos enteramos que se fua a trabajar  en una empresa que maquila para Adidas y Nike y que tiene mejores ingresos. - Edith Betancourt Betancourt', '2022-09-16', '38', '2023-03-14', NULL, 27),
(16, 'INDEPENDIENTE', 'Renuncia voluntaria, Informa que es tÃƒÂ©cnico de motos y que va a independizar, va a montar su propio taller de reparaciÃƒÂ³n de motos. Tuvo un buen desempeÃƒÂ±o laboral. - Leidy Cristina Pulgarin Gallego', '2022-09-30', '38', '2023-03-14', NULL, 76),
