(18, 'TERMINACION DE CONTRATO', 'Su desempeÃƒÂ±o fue bueno, Se alineÃƒÂ³ a los objetivos de la prÃƒÂ¡ctica realizando apoyo en programaciÃƒÂ³n y manejo CNC, desarrollo mantenimientos preventivos y correctivos de CNC y enchapadora de cantos.  Tuvo un punto dÃƒÂ©bil fue en las llegadas a tiempo, en lo cual se le hizo mucho ÃƒÂ©nfasis y tambiÃƒÂ©n quedÃƒÂ³ plasmado en la evaluaciÃƒÂ³n de prÃƒÂ¡cticas de la UTP. - Leidy Cristina Pulgarin Gallego', '2022-10-11', '38', '2023-03-14', NULL, 34),
(19, 'TERMINACION DE CONTRATO', 'Se le entregÃƒÂ³ carta de terminaciÃƒÂ³n contrato por sus ausencias injustificadas y falta de compromiso con la empresa. Manifesto que la iba a hacer revisar la carta de un abogado que porque su contrato se vencia era en febrero de cada aÃƒÂ±o, se validÃƒÂ³ el tema con don SalomÃƒÂ³n (Gerente de Talento Humano) y la fecha en que fue entregada la carta estaba dentro del marco legal, debido a que el contrato a termino fijo fue pactado a 11 meses inferior a un aÃƒÂ±o.\r\n\r\nFue muy irresponsable, evadÃƒÂ­a las causas por las cuales dejaba su trabajo, sus problemas personales con su pareja le afectaban notablemente su despeÃƒÂ±o laboral, debido a que no era capaz de controlar sus emociones. DÃƒÂ­as despuÃƒÂ©s renunciÃƒÂ³ de forma voluntaria manifestando que tenÃƒÂ­a otro empleo. - Leidy Cristina Pulgarin Gallego', '2022-10-14', '38', '2023-03-14', NULL, 15),
