(21, 'VOLUNTARIO', 'No continuÃƒÂ³ vinculado a la empresa debido a que entregÃƒÂ³ 1 Certificado de Incapacidad Falso de la NUEVA EPS, manifestÃƒÂ³ que es primo de Brallan Berjan y que fue ÃƒÂ©l quien le informo que ya habÃƒÂ­a entregado una incapacidad falsa y le enseÃƒÂ±o como hacerla; reconoce que es una falta grave, que estaba amaÃƒÂ±ado en la empresa pero que tiene que pagar por las consecuencias de sus actos y por dejarse influenciar de primo para realizar este acto tan deshonesto. - Leidy Cristina Pulgarin Gallego', '2022-10-20', '38', '2023-03-14', NULL, 209),
(22, 'VOLUNTARIO', 'No continuÃƒÂ³ vinculado a la empresa debido a su alto ÃƒÂndice de ausentismo, faltÃƒÂ³ varias veces sin justa causa informando que la mamÃƒÂ¡ sufre de diabetes, no entregÃƒÂ³ ningÃƒÂºn soporte y tampoco se comunicÃƒÂ³ con la empresa, fue suspendido 2 dÃƒÂ­as por este motivo, ademÃƒÂ¡s y mÃƒÂ¡s grave aÃƒÂºn entregÃƒÂ³ 2 Certificados de Incapacidad Falso de la NUEVA EPS, por tal motivo se confrontÃƒÂ³ y reconociÃƒÂ³ su grave falta. es primo de Jhon Wberly - Leidy Cristina Pulgarin Gallego', '2022-10-20', '38', '2023-03-14', NULL, 45),
(23, 'VOLUNTARIO', 'Renuncia Voluntaria, manifestÃƒÂ³ que no estaba teniendo una buena relaciÃƒÂ³n con el equipo de lÃƒÂ­deres de trabajo y que sentÃƒÂ­a que todos los inconvenientes de producciÃƒÂ³n lo seÃƒÂ±alaban a ÃƒÂ©l como culpable, quizÃƒÂ¡s por ser un lÃƒÂ­der mÃƒÂ¡s nuevo y pues que ya no estaba durmiendo bien, que ademÃƒÂ¡s manejar personal es muy complejo y que le resultÃƒÂ³ una mejor oferta laboral donde comenzarÃƒÂ¡ a partir de nov/22 y que mÃƒÂ¡s o menos en 2 aÃƒÂ±os desea regresar a Venezuela para manejar un taxi de la familia. Gustavo Ortiz (Asitente de PcciÃƒÂ³n) me informo que Edixon querÃƒÂ­a que todo saliera perfecto en producciÃƒÂ³n y ese mundo ideal no existe, que deben se muy flexibles y saberle dar manejo a los imprevistos de cada dÃƒÂ­a, cuando ingreso a la empresa tenÃƒÂ­a muy buena actitud e inicitiativa para elaboraciÃƒÂ³n de plantillas pero era muy desordenado con su trabajo. - Leidy Cristina Pulgarin Gallego', '2022-10-31', '38', '2023-03-14', NULL, 16),
(24, 'VOLUNTARIO', 'Renuncia Voluntaria, debido a que solicitÃƒÂ³ un permiso o que le liquidaran vacaciones por motivo de viaje a Francia - Europa  por 2 meses y medio para visitar a una hermana y familiares que tiene allÃƒÂ¡, y no fue viable su solicitud. Se le informo a Edward que si regresa al pais y hay vacantes puede concursar nuevamente para vincularse a la empresa sin ningÃƒÂºn compromiso; su desempeÃƒÂ±o fue bueno, es muy respuetuoso. - Leidy Cristina Pulgarin Gallego', '2022-11-11', '38', '2023-03-14', NULL, 43),
