(27, 'TERMINACION DE CONTRATO', '\n\nSe definiÃƒÂ³ su contrato en periodo de prueba debido al alto nivel de ausentismo, ingresÃƒÂ³ el 2 de noviembre y ya tenÃƒÂ­a 3 incapacidades, ademÃƒÂ¡s tuvo un mal desempeÃƒÂ±o laboral. - Leidy Cristina Pulgarin Gallego', '2022-11-21', '39', '2023-03-14', NULL, 222),
(28, 'VOLUNTARIO', '\n\nConcepto emitido por la FÃƒÂ¡brica: Renuncia Voluntaria, debido a que se fue a vivir a Costa Rica con los hijos y el esposo, allÃƒÂ¡ tiene una hermana y un hermano, lo que ella expone es que por acÃƒÂ¡ le toca muy duro porque el papa de los niÃƒÂ±os no le ayuda mucho con ellos ( no es su pareja actual) y que los niÃƒÂ±os permanecen prÃƒÂ¡cticamente solos, porque su mamÃƒÂ¡ solo va y les da el desayuno y el almuerzo, y ella no puede estar muy pendiente de ellos dice que por allÃƒÂ¡ si trabajarÃƒÂ­a pero no unas jornadas tan largas entonces puede estar mÃƒÂ¡s pendiente de ellos. Su desempeÃƒÂ±o fue bueno. - Leidy Cristina Pulgarin Gallego', '2022-12-30', '39', '2023-03-14', NULL, 58),
(29, 'VOLUNTARIO', '\n\nConcepto Emitido por la fÃƒÂ¡brica: Retiro Voluntario, estaba buscando cambiar de empleo debido a que no se conectÃƒÂ³ con las actividades de la empresa, a pesar que estaba reubicada en tapicerÃƒÂ­a haciendo diversas labores, como auxiliar de costura, mesa de corte, espumados, desbaratada de servicios tÃƒÂ©cnicos, pero no se adaptÃƒÂ³ al proceso. Su desempeÃƒÂ±o fue bueno. - Leidy Cristina Pulgarin Gallego', '2022-12-30', '39', '2023-03-14', NULL, 224),
(30, 'VOLUNTARIO', '\n\nConcepto emitido por la FÃƒÂ¡brica: Retiro Voluntario, por viaje a Chile donde vive su tÃƒÂ­a hace 7 aÃƒÂ±os, pensÃƒÂ³ mucho en tomar la decisiÃƒÂ³n dice que casi un aÃƒÂ±o, porque por la empresa el vivÃƒÂ­a muy motivado cerca a su casa, sin trabajar los sÃƒÂ¡bados pero puso sobre la balanza y su familia le ayudÃƒÂ³ a tomar la decisiÃƒÂ³n, dice que llega con trabajo en una empresa de baldosas en el ÃƒÂ¡rea logÃƒÂ­stica. Su desempeÃƒÂ±o fue excelente.\r\nLuego nos enteramos que en realidad no viajo a Chile, sino que se fue a trabajar a la fÃƒÂ¡brica de arepas del hijo del seÃƒÂ±or Javier Jaramillo (retirado por pensiÃƒÂ³n) aqui en Dosquebradas.\r\n\r\nSe hablÃƒÂ³ con ÃƒÂ©l dos veces y se le dijo que reconsidera su decisiÃƒÂ³n, pero nos caÃƒÂ±ÃƒÂ³ con mentiras y se fue a trabajar a Audifarma que es donde trabaja el hijo del seÃƒÂ±or Javier Jaramillo. - Leidy Cristina Pulgarin Gallego', '2022-12-30', '39', '2023-03-14', NULL, 90),
(31, 'VOLUNTARIO', '\n\nConcepto emitido por la FABRICA: Renuncia voluntarria, InformÃƒÂ³ que estaba amaÃƒÂ±ado en la empresa,que hay un buen ambiente laboral y que es debido a que se va a reintegrar a su empleo anterior donde trabajan carpinterÃƒÂ­a para edificios de la Constructora CFC, el cual queda por los lados de la Postrera, trabajarÃƒÂ¡ solo hasta las 3 p.m y es mÃƒÂ¡s cerca a Santa Rosa y que aquÃƒÂ­ se le dificulta mÃƒÂ¡s el transporte de regreso para su casa, que a veces le dan las 7:30 p.m sin poder abordar la buseta y le da miedo manejar moto y que ademÃƒÂ¡s a su esposa le van a realizar una cirugÃƒÂ­a delicada de la matriz entonces que a ÃƒÂ©l le toca despacharse su comida y tambiÃƒÂ©n cuidarla a ella en su recuperaciÃƒÂ³n de la operaciÃƒÂ³n.\r\n\r\nJhon Jairo manifestÃƒÂ³ que le gusta quedar con las puertas abiertas por si mÃƒÂ¡s adelante se dan las cosas para volver, que por eso estÃƒÂ¡ renunciando con tiempo, pero la Jefe de ProducciÃƒÂ³n notifica que tenia bajo rendimiento en su trabajo (De una CalificaciÃƒÂ³n de 1 a 10 le otorgÃƒÂ³ un 4), tambiÃƒÂ©n se programÃƒÂ³ para que trabajara el  17/dic/22 Horas Extras y no se presentÃƒÂ³ y tampoco informÃƒÂ³ que no podia venir, le faltÃƒÂ³ compromiso. - Leidy Cristina Pulgarin Gallego', '2022-12-30', '39', '2023-03-14', NULL, 63),
(32, 'VOLUNTARIO', '\n\nConcepto Emitido por la FÃƒÂ¡brica: Retiro voluntario, manifestando que viajarÃƒÂ¡ para Ecuador, el rendimiento fue regular (en una calificaciÃƒÂ³n de 1 a 5 siendo 1 el mÃƒÂ¡s bajo serÃƒÂ­a un 3, debido a que fue muy demorado en los tiempos). - Leidy Cristina Pulgarin Gallego', '2023-01-02', '39', '2023-03-14', NULL, 199),
(33, 'TERMINACION PRACTICA APRENDIZ', 'TerminÃƒÂ³ su prÃƒÂ¡ctica Universitaria, presto apoyo en la secciÃƒÂ³n de maquinado operando la mÃƒÂ¡quina CNC y estaba asignado al departamento de mantenimiento; era concreto con lo que se le asignaba, no se observÃƒÂ³ que buscara que hacer, tocaba mantenerlo programado, pero en general realizaba lo programado. - Edith Betancourt Betancourt - Leidy Cristina Pulgarin Gallego', '2023-01-04', '39', '2023-03-14', NULL, 195),
(34, 'VOLUNTARIO', '\n\nNo continuo vinculado a la empresa, debido a su alto indice de ausentismo, su desempeÃƒÂ±o fue bueno pero es claro que su evoluciÃƒÂ³n en cuanto a aspectos discipiliarios de cumplimiento es deficiente y perturba los programas de producciÃƒÂ³n que previamente se han planificado.\r\n\r\nSe le realiizÃƒÂ³ evaluaciÃƒÂ³n de desempeÃƒÂ±o y posteriormente tomo la decisiÃƒÂ³n de renunciar de forma voluntaria. - Edith Betancourt Betancourt', '2023-01-06', '39', '2023-03-15', NULL, 212),
(35, 'BAJA PRODUCTIVIDAD', 'Retiro voluntario, debido a que se molestÃƒÂ³ porque le llamaron la atenciÃƒÂ³n debido a que estaba charlando con sus compaÃƒÂ±eros en horario laboral y tambiÃƒÂ©n le molestaba la presiÃƒÂ³n que tenia con el tema del control de los tiempos para trabajar en producciÃƒÂ³n.\r\n\r\nSu desempeÃƒÂ±o fue bueno, pero hubiera sido mejor si mejoraba sus actos de indisciplina, conversaba mucho con sus compaÃƒÂ±eros de trabajo. \r\n\r\nSe retirÃƒÂ³ el 13 viernes y el lunes 16 enviÃƒÂ³ mensaje por whatsapp a la administradora reclamando que porque no le habÃƒÂ­an pagado los dÃƒÂ­as de esta quincena y que si le ÃƒÂ­bamos a pagar por cada dÃƒÂ­a de retraso.  - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-01-13', '39', '2023-03-15', NULL, 59),
