(37, 'ESTUDIOS', '\n\nRenuncia voluntaria, por motivo de estudio ya que debe terminar materias y trabajo de grado este semestre en la universidad en jornada diurna, su desepeÃƒÂ±o fue muy bueno. - Edith Betancourt Betancourt', '2023-01-19', '39', '2023-03-15', NULL, 29),
(38, 'INDEPENDIENTE', 'PRIMER INGRESO DEL 21 DE ABRIL DE 2003 AL 02 DE FEBRERO DE 2019 - EL RETIRO FUE VOLUNTARIO (CRISTINA PG) - Leidy Cristina Pulgarin Gallego\n\nRenunciÃƒÂ³ de forma voluntaria, debido a que va a Administrar uno de los negocios \"Parrillada\" en Ciudad Victoria, que comprÃƒÂ³ su hijastra con el esposo, debido a que ellos viven en PerÃƒÂº y necesita a una persona de Confianza para que les administre este local, porque la persona que tienen actualmente les estÃƒÂ¡ robando y  que ella va a ganar un poco mÃƒÂ¡s de dinero. Finalmente nos enteramos que se fua a trabajar con Lililiana Garcia otra Costurera que trabajÃƒÂ³ en la empresa, que estan trabajando en una empresa que Maquila para Adidas y Nike y que tienen mejores ingresos.\r\n\r\nFue una empleada de mucha trayectoria y confianza en la empresa de 19 aÃƒÂ±os, se caracterizÃƒÂ³ por ser muy responsable con su trabajo, era un poco bipolar con respecto a su temperamento. - Edith Betancourt Betancourt', '2023-01-30', '39', '2023-03-15', NULL, 84),
(39, 'PENSION POR VEJEZ Y/O INVALIDEZ', '\n\nRetiro Voluntario debido a que aL finalizar el mes de enero/2023 recibiÃƒÂ³ su primera mesada pensional. Se caraterizÃƒÂ³ por ser muy colaborador, amable y respetuoso con su sus compaÃƒÂ±eros, con gran sentido de pertencia por la empresa. - Edith Betancourt Betancourt', '2023-01-30', '39', '2023-03-15', NULL, 28),
(40, 'MEJOR OFERTA LABORAL', 'TUVO VARIOS INGRESOS: DEL 09/10/2012 AL 31/12/2012 = SE LIQUIDÃƒÂ“ POR VACACIONES COLECTIVAS DE LA FABRICA.\r\nDEL 28/01/ 2013 AL 02/09/2019 Y EL ULTIMO INGRESO FUE DE 03/10/2019 AL 03/02/2023 - Leidy Cristina Pulgarin Gallego\n\nSe le llamo la atenciÃƒÂ³n en varias oportunidades por escrito debido a que se distraÃƒÂ­a con facilidad con los dispositivos electrÃƒÂ³nicos (computador y celular) en actividades diferentes a las laborales. \r\n\r\nSolicitÃƒÂ³ aumento de salario y la empresa revisÃƒÂ³ su solicitud pero como no fue viable, ÃƒÂ©l manifestÃƒÂ³ que iba a renunciar en 5 dÃƒÂ­as, debido a que le habÃƒÂ­a resultado otra oferta laboral. Las materias primas del almacÃƒÂ©n las tuvo que recibir el Auxiliar de AuditorÃƒÂ­a debido a que su reemplazo alcanzÃƒÂ³ a entrar solo la tarde en que ÃƒÂ©l se retirÃƒÂ³; cuando se pudieron establecer las diferencias del inventario ÃƒÂ©l ya no estaba para responder por ellas y por tal motivo se tuvieron que ajustar. \r\n\r\nOrlando solicito que le pagaran su liquidaciÃƒÂ³n y que la empresa no le podÃƒÂ­a retrasar el pago de sus prestaciones sociales por las diferencias que tenÃƒÂ­a con el inventario, asumiendo un comportamiento muy irresponsable, le faltÃƒÂ³ gratitud con la empresa. - Edith Betancourt Betancourt', '2023-02-03', '39', '2023-03-15', NULL, 8),
(41, 'TERMINACION DE CONTRATO', '\n\nTerminaciÃƒÂ³n contrato debido a que tuvo muchas inasistencias y no se le veia amor o dedicaciÃƒÂ³n hacia el trabajo, era marrullero en temas de productividad, fue muy inestable con temas mÃƒÂ©dicos. ManifestÃƒÂ³ que ÃƒÂ©l ingresÃƒÂ³ bien de salud y que iba a salir enfermo de la columna pero no tuvo ningÃƒÂºn AT, por tal motivo se le enviaron a realizar los exÃƒÂ¡menes mÃƒÂ©dicos de retiro, tambiÃƒÂ©n solicitÃƒÂ³ copia de su contrato laboral para llevarsela a un abogado cuando se le entregÃƒÂ³ la carta de terminaciÃƒÂ³n contrato. - Edith Betancourt Betancourt', '2023-02-25', '39', '2023-03-15', NULL, 192),
(42, 'VOLUNTARIO', '\n\nRetiro voluntario, manifestÃƒÂ³ que como ya terminÃƒÂ³ su carrera como administradora de empresas, desea buscar un empleo mÃƒÂ¡s afÃƒÂ­n a lo que estudiÃƒÂ³, en trabajos administrativos y no de producciÃƒÂ³n. TambiÃƒÂ©n tenÃƒÂ­a programado un viaje a la costa con su familia y la operaciÃƒÂ³n de su hija debido a que es cabeza de familia.  La empresa tuvo la intenciÃƒÂ³n de promoverla al cargo de Auxiliar de auditorÃƒÂ­a en prÃƒÂ³ximos meses y brindarle el permiso para acompaÃƒÂ±ar a su hija a la cirugÃƒÂ­a, pero manifestÃƒÂ³ que no podÃƒÂ­a esperar y que mejor se retiraba. Su desempeÃƒÂ±o fue bueno. - Edith Betancourt Betancourt\n\nCumplÃƒÂ­a los requerimientos del cargo de buena manera, mantenÃƒÂ­a la documentaciÃƒÂ³n al dÃƒÂ­a, se le hizo en dos ocasiones la observaciÃƒÂ³n sobre no entablar conversaciones largas con los operarios por el tema de los tiempos no aplicables y los tomÃƒÂ³ de muy buena manera. - Edith Betancourt Betancourt', '2023-02-27', '39', '2023-03-15', NULL, 205),
(43, 'VIAJE A OTRO PAIS', 'TerminaciÃƒÂ³n Contrato, se definiÃƒÂ³ en periodo de prueba debido a que informÃƒÂ³ que solo podrÃƒÂ­a trabajar hasta abril/23, puesto que viajarÃƒÂ¡ a Chile a cuidar a su hija que va a tener bebe, en la entrevista no manifestÃƒÂ³ tener intenciones de viajar. La seÃƒÂ±ora fue muy complicada durante sus pocos dÃƒÂ­as de estadÃƒÂ­a en la empresa, solicitÃƒÂ³ una silla con rodachines, realizÃƒÂ³ varios cambios de dotaciÃƒÂ³n de las botas por la talla, manifestÃƒÂ³ tambiÃƒÂ©n que ella no escucha la mÃƒÂºsica de la planta sino mÃƒÂºsica cristiana y tambiÃƒÂ©n le realizÃƒÂ³ el comentario a una compaÃƒÂ±era de que aquÃƒÂ­ en la fÃƒÂ¡brica no se la iba a dejar montar de nadie. - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-02-06', '40', '2023-03-15', NULL, 245),
(44, 'VOLUNTARIO', 'Retiro Voluntario, faltÃƒÂ³ al trabajo sin justa causas varias veces,  InformÃƒÂ³ que el horario de la fÃƒÂ¡brica no le favorece para realizar las diligencias de sus hijas y su mamÃƒÂ¡, que el sÃƒÂ¡bado no las alcanza a realizar todas y que ademÃƒÂ¡s no le gustÃƒÂ³ pagar las horas del dÃƒÂ­a que nos quedamos sin servicio de energÃƒÂ­a elÃƒÂ©ctrica.  - Edith Betancourt Betancourt', '2023-03-08', '40', '2023-03-15', NULL, 241),
(45, 'OTRA', 'Retiro Voluntario. Se le entregÃƒÂ³ carta de terminaciÃƒÂ³n contrato pero ÃƒÂ©l decidiÃƒÂ³ renunciar. Se le dificultaba entender y desarrollar actividades eficientemente inclusive las mÃƒÂ¡s sencillas, no captaba bien las instrucciones, tuvo ausencias por incapacidades de 2 dÃƒÂ­as c/u. - Edith Betancourt Betancourt', '2023-03-14', '1', '2023-03-27', NULL, 239),
(46, 'BAJA PRODUCTIVIDAD', 'TerminaciÃƒÂ³n contrato en periodo de prueba, debido a sus continuas llegadas tarde, se le habÃƒÂ­a realizado un llamado de atenciÃƒÂ³n por escrito, sin embargo continuo reincidiendo en esta situaciÃƒÂ³n, ademÃƒÂ¡s las personas que lo direccionaron en el proceso, informaron que era muy pasivo y con poco ritmo de trabajo y a pesar que se le realizÃƒÂ³ ÃƒÂ©nfasis en esto, hizo caso omiso de las sugerencias de mejora.  - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-03-15', '1', '2023-03-27', NULL, 248),
(47, 'MEJOR OFERTA LABORAL', 'Voluntario, debido a que comenzarÃƒÂ¡ a realizar las prÃƒÂ¡cticas como TecnÃƒÂ³logo en Adm. de Empresas, pendiente definir por la Universidad de Comfamiliar y ademÃƒÂ¡s los horarios estÃƒÂ¡n afectando sus estudios. Se validÃƒÂ³ su desempeÃƒÂ±o con la Jefe de ProducciÃƒÂ³n y manifestÃƒÂ³ que era muy hablador en las jornadas laborales y  no acatÃƒÂ³ las observaciones que el LÃƒÂ­der le realizÃƒÂ³ al respecto, cuando finalizaba la jornada laboral no respetaba la fila para salir. - Edith Betancourt Betancourt', '2023-03-30', '1', '2023-04-21', NULL, 97),
(48, 'PENSION POR VEJEZ Y/O INVALIDEZ', 'Retiro Voluntario por motivo de que le fue reconocida su pensiÃƒÂ³n de Vejez, se caracterizÃƒÂ³ por ser un excelente compaÃƒÂ±ero, muy conectado con los objetivos de la organizaciÃƒÂ³n, con una energÃƒÂ­a de un joven de 15 aÃƒÂ±os, fue muy respetuoso y colaborador, siempre con la mejor actitud.  Tuvo varios periodos de ausentismo (accidentes de trabajo e incapacidades por enfermedad general). - Edith Betancourt Betancourt', '2023-03-31', '1', '2023-04-21', NULL, 81),
(49, 'MEJOR OFERTA LABORAL', 'Retiro Voluntario, debido a que comenzarÃƒÂ¡ a trabajar en una FerreterÃƒÂ­a por Cuba donde le pagarÃƒÂ¡n $750.000 quincenalmente, como Auxiliar de Carga y debe trabajar los sÃƒÂ¡bados. La Jefe de ProducciÃƒÂ³n informÃƒÂ³ que ya se le habÃƒÂ­a realizado un ajuste salarial y solicitÃƒÂ³ nuevamente otro ajuste, pero se le informÃƒÂ³ que se debÃƒÂ­a de capacitar primero en otras mÃƒÂ¡quinas, comenzÃƒÂ³ este proceso, pero no estaba teniendo un buen desempeÃƒÂ±o. - Edith Betancourt Betancourt', '2023-03-31', '1', '2023-04-21', NULL, 98),
(50, 'PROBLEMAS ECONOMICOS', 'Retiro Voluntario, manifiestÃƒÂ³ que esta amaÃƒÂ±ada en la empresa, pero que el salario no le alcanza para cubrir sus necesidades econÃƒÂ³micas, debido a que estÃƒÂ¡ atrasada en el banco con varias cuotas y que necesita el dinero que tiene de las cesantÃƒÂ­as para pagar esta deuda. La empresa le realizÃƒÂ³ un anticipo a la liquidaciÃƒÂ³n de $700.000 para que no renunciara el 11 de marzo/2023  sino que trabajara hasta fin de mes, tambiÃƒÂ©n se le informÃƒÂ³ que podÃƒÂ­a refinanciar la deuda en el banco, pero ella manifiesto que si extendÃƒÂ­a el plazo, pagarÃƒÂ­a mÃƒÂ¡s dinero, y no estaba de acuerdo.  Su desempeÃƒÂ±o fue muy bueno.\r\n\r\nEra muy alegre, tenia buen rendimiento y conocimiento sobre las series, debido a los cambios de las costureras tomÃƒÂ³ el liderazgo en la secciÃƒÂ³n, se le realizaron observaciones sobre no bailar en las ÃƒÂ¡reas de trabajo y de ciertas posturas cuando estaba capacitando a las compaÃƒÂ±eras y las tomo de buena manera. - Edith Betancourt Betancourt', '2023-03-31', '1', '2023-04-21', NULL, 35),
(51, 'MEJOR OFERTA LABORAL', 'Retiro Voluntario, manifestÃƒÂ³ que tenÃƒÂ­a sobrecarga laboral y un Contratista le estaba ofreciendo un salario de $1.500.000 para un trabajo en una obra de 10 aÃƒÂ±os. \r\n\r\nElla habÃƒÂ­a solicitado que vincularan a otra persona a travÃƒÂ©s de contrato de aprendizaje o laboral para que la apoyaran en su trabajo de forma provisional mientras la Coordinadora de SST se reintegraba de la licencia de maternidad, la empresa revisÃƒÂ³ la solicitud y le informÃƒÂ³ que no era posible, se revisaron sus funciones y se redistribuyeron 15 y se le ofreciÃƒÂ³ un bono provisional de $200.000, pero ella no aceptÃƒÂ³ la propuesta, confirmando el 14 de marzo su retiro.\r\n\r\nSu desempeÃƒÂ±o fue excelente, fue de gran apoyo administrativo, se caracterizÃƒÂ³ por manejar muy buenas relaciones interpersonales en la empresa, siempre estuvo con la mejor actitud para colaborar con lo que las diferentes ÃƒÂ¡reas y personas requerÃƒÂ­an citas mÃƒÂ©dicas e informaciÃƒÂ³n.   - Edith Betancourt Betancourt', '2023-04-05', '1', '2023-04-21', NULL, 94),
(52, 'ESTUDIOS', 'Retiro Voluntario, debido a que estudio una tecnologÃƒÂ­a en AdministraciÃƒÂ³n de Empresas y quiere continuar con el ciclo Profesional y luego poder trabajar en lo que estudiÃƒÂ³. Se le realizÃƒÂ³ un proceso disciplinario con Acta de Descargos debido a que se ausentÃƒÂ³ de la jornada laboral sin tener consentimiento ni autorizaciÃƒÂ³n, debido a que el permiso se le habÃƒÂ­a negado por motivo de cierre de mes. - Edith Betancourt Betancourt', '2023-04-14', '1', '2023-04-21', NULL, 38),
