(56, 'MEJOR OFERTA LABORAL', 'RenunciÃƒÂ³ por motivos econÃƒÂ³micos, informÃƒÂ³ que no le alcanzaba el dinero para enviar a Venezuela, por tal motivo regresarÃƒÂ¡ a su anterior empleo REYCO (fÃƒÂ¡brica de Jeans), pero con mejores condiciones en la secciÃƒÂ³n de terminado.\r\n\r\nSe le realizÃƒÂ³ un llamado de atenciÃƒÂ³n por reprocesos en la Molturadora, las observaciones que se le realizaron las tomÃƒÂ³ de buena manera.\r\n\r\nSe promoviÃƒÂ³ como LÃƒÂ­der de Lija y Pintura y se devolviÃƒÂ³ a los 15 dÃƒÂ­as como operario, debido a que no le fue bien en el proceso de anÃƒÂ¡lisis y coordinaciÃƒÂ³n.\r\n - Edith Betancourt Betancourt', '2023-05-12', '1', '2023-05-17', NULL, 210),
