(93, 'OTRA', 'No continuÃƒÂ³ vinculado a la empresa debido a que informo que su madre padecÃƒÂ­a un cÃƒÂ¡ncer severo y por tal motivo la empresa le facilitÃƒÂ³ varios permisos remunerados, manifestando que su madre era beneficiaria del SISBEN y que ÃƒÂ©l era el ÃƒÂºnico de 6 hermanos que estaba pendiente de ella, quien se encontraba en el Hospital San Jorge en el 4 piso; pero todo fue un engaÃƒÂ±o, la empresa pudo verificar que su Madre es cotizante hace varios aÃƒÂ±os, por tal motivo se llamÃƒÂ³ a relaciÃƒÂ³n donde confeso que todo era falso y que ÃƒÂ©l se encontraba en problemas familiares con su esposa quien lo traicionÃƒÂ³ y se encontraba en proceso de separaciÃƒÂ³n y que ÃƒÂ©l no le encontraba sentido a vivir mÃƒÂ¡s, sin embargo esta situaciÃƒÂ³n no justifica sus mentiras. Su desempeÃƒÂ±o fue bueno, pero su comportamiento en cuanto a principios morales y ÃƒÂ©ticos hacen referencia de que no es una persona confiable. - Edith Betancourt Betancourt - Edith Betancourt Betancourt', '2023-10-06', '1', '2023-10-24', NULL, 189),
(94, 'PROBLEMAS FAMILIARES', 'Se retirÃƒÂ³ de forma voluntaria, manifestÃƒÂ³ que no podÃƒÂ­a continuar vinculado a la empresa debido a que su hermano estÃƒÂ¡ en conflicto con unos vecinos del Barrio Tokio donde residen en Pereira y tienen amenazada a su familia y por tal motivo se va a trasladar con su mamÃƒÂ¡ y hermano para MedellÃƒÂ­n.\r\n\r\nSu desempeÃƒÂ±o fue bueno, se demorÃƒÂ³, pero finalmente se adaptÃƒÂ³ al proceso, manejaba tiempos cerca al estÃƒÂ¡ndar. Se le realizÃƒÂ³ afectaciÃƒÂ³n de nÃƒÂ³mina por faltar al trabajo sin justa causa debido a que se le solicitaba que presentara los soportes de ausencias pero no lo hizo, en una ocasiÃƒÂ³n informÃƒÂ³ que la mama estaba enferma pero no presentÃƒÂ³ los documentos de su atenciÃƒÂ³n - Edith Betancourt Betancourt', '2023-10-13', '1', '2023-10-24', NULL, 213),
(95, 'VIAJE A OTRO PAIS', 'Su retiro fue voluntario, se destacÃƒÂ³ por su amabilidad y respeto, cuando ingresÃƒÂ³ a la secciÃƒÂ³n de TapicerÃƒÂ­a como operario fue difÃƒÂ­cil adaptarse al proceso y tiempos, pero en la parte de terminado finalmente le empezÃƒÂ³ a ir bien, se le llamÃƒÂ³ varias veces la atenciÃƒÂ³n en su conducta por charlar con los compaÃƒÂ±eros de trabajo y con la practicante de DiseÃƒÂ±o y Calidad Natalie, fue una conducta que finalmente logrÃƒÂ³ mejorar. \r\n\r\nEn julio/23, fue promovido al cargo de auxiliar de auditorÃƒÂ­a; se le realizÃƒÂ³ retroalimentaciÃƒÂ³n sobre los aspectos a mejorar y expresÃƒÂ³ su deseo de no continuar vinculado con la empresa, debido que tiene planes de irse a vivir a EspaÃƒÂ±a a finales de dic/23 para trabajar en la empresa de su tÃƒÂ­a. - Edith Betancourt Betancourt\n\nSolicito aumento de salario por su cambio de cargo de operario de tapicerÃƒÂ­a a auxiliar de auditoria, pero se le informo que debÃƒÂ­a de tener la permanencia de1 aÃƒÂ±o en el puesto para poder evaluar si se le autorizaba el aumento.  - Santiago Elias Murillo Henao', '2023-10-20', '1', '2023-10-24', NULL, 82),
