(37, '2', '214', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'No emplea apropiadamente su tiempo, hablÃƒÂ© con el en el mes de diciembre haciÃƒÂ©ndole ÃƒÂ©nfasis de ser mas productivo y no parar antes del timbre. Se distrae muy fÃƒÂ¡cilmente en actividades asignadas, no comprende trabajos sencillos asignados. No tiene mucha fuerza fÃƒÂ­sica para hacer tareas de cargue y descargue.', 'NO', 'bg-success', '2023-02-10', '2023-02-10'),
(38, '1', '75', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Es una persona que esta tomando un rol diferente a los puestos de trabajo que habÃƒÂ­a tenido anteriormente y obviamente necesita una formaciÃƒÂ³n en el proceso, pero necesitamos que vaya tomando en cuenta las observaciones y sugerencias que se la han dado. La idea es que tome el rol de supervisor, que no se vea tan sentado en el puesto de trabajo y este mas activo en la secciÃƒÂ³n supervisando e inspeccionando producto. Reunir al grupo de trabajo y contar las metas colectivas ademÃƒÂ¡s de las metas no alcanzadas debe realizarse. Antes de empezar a trabajar una serie debe reunir al grupo de trabajo y mirar cual es el mejor mÃƒÂ©todo, ademÃƒÂ¡s como no conoce las series en este proceso de lija y pintura tambiÃƒÂ©n debe pedir informaciÃƒÂ³n sobre lo que es importante en la serie o no. El proceso de canalizaciÃƒÂ³n de pintura no se debe adjudicar a otra persona a no ser que sea autorizada por la jefatura de producciÃƒÂ³n previa capacitaciÃƒÂ³n. Debe seguir en este proceso de formaciÃƒÂ³n. ', 'SI', 'bg-success', '2023-02-14', '2023-02-14'),
(39, '1', '219', 'COMPLETADO', 'Sistemas Muebles Albura', 'AUXILIAR EN DESARROLLO WEB', 'Pruebas', 'SI', 'bg-success', '2023-02-16', '2023-02-16'),
