(41, '2', '239', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'le cuesta aprender procesos incluso procesos sencillos  . se ha  ausentado dos veces en poco tiempo de pertenecer a la empresa.', 'NO', 'bg-success', '2023-03-01', '2023-03-01'),
(42, '2', '232', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Tiene un ritmo muy lento.  ', 'NO', 'bg-success', '2023-03-03', '2023-03-03'),
(43, '2', '233', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Debe mejorar la relaciÃƒÂ³n laboral con sus compaÃƒÂ±eras. ', 'SI', 'bg-success', '2023-03-24', '2023-03-24'),
(44, '2', '234', 'COMPLETADO', 'Juan Manuel Galvis Velez ', 'LIDER DE LIJA Y PINTURA', 'Puede mejorar el ritmo de trabajo, es aplicado, aprende rÃƒÂ¡pido, es disciplinado, ordenado y tiene muy buena disposiciÃƒÂ³n para hacer cualquier tipo de labor que se le pida ', 'SI', 'bg-success', '2023-03-24', '2023-03-24'),
(45, '1', '99', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Yuliana viene haciendo un proceso de capacitaciÃƒÂ³n interesante en el proceso,  se interesa por gestionar procesos y las instrucciones que se le dan tanto para ella como para su equipo de trabajo las gestiona rÃƒÂ¡pidamente y las lleva a cabo. En la parte de calidad se deben reforzar procesos, metodologÃƒÂ­as para evitar reprocesos y entregas fallidas a los clientes internos, debe apoyarse en el material de trabajo como un todo en la parte de planos y especificaciones tÃƒÂ©cnicas. En la parte operativa tiene una buena interacciÃƒÂ³n con las personas a su cargo y se interesa por comunicar sus inquietudes y sugerencias, con sus pares debe mejorar la escucha activa y receptiva de los mensajes que se le transfieren. Ya a nivel de equipo debemos seguir trabajando en la capacitaciÃƒÂ³n en el manejo de maquinaria y en los planes de capacitaciÃƒÂ³n documentados. Las listas de chequeo deben reflejar la realidad del producto elaborado. Tiene potencial para seguir con las funciones del cargo. ', 'SI', 'bg-success', '2023-04-19', '2023-04-19'),
(46, '2', '237', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Ha avanzado en el proceso de tapizado y se esfuerza por cumplir las metas.', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(47, '2', '238', 'COMPLETADO', 'Yuliana  Cifuentes Rodriguez ', 'LIDER DE MAQUINADO', 'SE REQUIERE QUE LE PONGA MAS ANIMO DE APRENDER OTRA OPERACION, SER MAS CONCENTRADO PARA QUE CAPTE TAREAS COMPLEJAS, ESTA MUY ACOSTUBRADO AL TABAJO MONOTONO.\r\nSER MAS ORDENADO CUANDO SE PONE HACER OTRA FUNCION DIFERENTE A AUX Y CARGUE, Y PREGUNTAR CUANDO NO ENTIENDA LO QUE SE LE PONE HACER, LA MAYORIA DE LAS VECES SE QUEDA CON LA DUDA Y LO HACE COMO CREE O CON LO POCO QUE ENTENDIO.', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(48, '2', '244', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Ha mejorado la relaciÃƒÂ³n con sus compaÃƒÂ±eras, esperamos que siga asÃƒÂ­. ', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(49, '3', '240', 'ACTIVA', '', '', '', '', 'bg-danger', '2023-05-10', '2023-05-10'),
(50, '2', '236', 'COMPLETADO', 'Andres  Gaviria Ortiz ', 'LIDER DE ENSAMBLE', '', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(51, '3', '242', 'EN CURSO', '', '', '', '', 'bg-warning', '2023-05-10', '2025-05-10'),
(52, '3', '243', 'COMPLETADO', 'Edith Betancourt Betancourt', 'ADMINISTRADORA', 'Tiene buena actitud en el trabajo, es colaborador y respetuoso.\r\nSe le han realizado observaciones verbales de  que no debe usar piercings en la fabrica.', 'SI', 'bg-success', '2023-05-10', '2023-05-10'),
(53, '2', '261', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'No ha logrado mejorar los rendimientos, debe mejorar mucho la calidad, utiliza tiempo del horario del trabajo para otras actividades como el celular, a veces pide cambio en las actividades que esta ejecutando aun siendo trabajos no complejos como un somier.', 'NO', 'bg-success', '2023-05-31', '2023-05-31'),
(54, '1', '20', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'es un lÃƒÂ­der en formaciÃƒÂ³n con aptitudes que cada vez va moldeando mas de acuerdo a los parÃƒÂ¡metros de la empresa. Se esfuerza por cumplir las tareas asignadas y los retos encomendados. Es necesario seguir liderando el grupo de trabajo hacia la inspecciÃƒÂ³n y aseguramiento de procesos ya que lastimosamente en esta parte se ha fallado un poco con devoluciÃƒÂ³n de producto por clientes internos y tambiÃƒÂ©n como clientes externos como Happy Sleep. Tiene muy buena disposiciÃƒÂ³n y maneja de una madera adecuada los inventarios . ', 'SI', 'bg-success', '2023-06-22', '2023-06-22'),
(55, '1', '48', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Yeraldine es una chica que ya lleva en el proceso un tiempo donde se esperarÃƒÂ­a que fuera mas activa, con iniciativa para acciones de mejora y empoderada del tema, pero no va mas allÃƒÂ¡ de lo que se le pide, el proceso con ella es muy lineal. No hace planes de verificaciÃƒÂ³n e inspecciÃƒÂ³n. No cumple con los parÃƒÂ¡metros estipulados en pro de la mejora, habla mucho con personas en horarios laborales.  ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(56, '1', '75', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Juan Manuel es una persona de planta que aceptÃƒÂ³ el reto de liderar el proceso de lija y pintura. En tÃƒÂ©rminos de manejo de materia prima e inventarios pudo sacar adelante los procesos aunque no con mucho sentido de pertenencia, hubo ÃƒÂ­tems que inclusive no administraba de manera conciente. En el manejo de personal se quedÃƒÂ³ muy corto y no daba ejemplo en su hacer. Muy desconectado en el proceso con los objetivos de la empresa. ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(57, '1', '99', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Yuliana es una lÃƒÂ­der que se esforzÃƒÂ³ en este nuevo rol y a pesar del corto tiempo superÃƒÂ³ los objetivos del proceso.  En su ÃƒÂºltimo perÃƒÂ­odo como lÃƒÂ­der de la secciÃƒÂ³n se alejÃƒÂ³ de algunos procedimientos y le faltÃƒÂ³ mas comunicaciÃƒÂ³n con el jefe de proceso.  Se le dificultÃƒÂ³ el trabajo en equipo con sus pares sin embargo con el grupo que dirigÃƒÂ­a se viÃƒÂ³ menos este efecto. ', 'SI', 'bg-success', '2023-06-22', '2023-06-22'),
(58, '5', '31', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'debe tener mas concentraciÃƒÂ³n y agilidad en el proceso, debe mejorar la comunicacion y saber que informaciÃƒÂ³n afecta el proceso, es insegura y por ello a veces se cometen errores. Le falta tener una visiÃƒÂ³n mas global del proceso. ', 'SI', 'bg-success', '2023-06-22', '2023-06-22'),
(59, '2', '22', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'ya es tiempo que sea mas agil en el proceso, que sea autÃƒÂ³nomo y no requiera continua supervisiÃƒÂ³n, debe ser mas activo no ha pasado de ayudante o funciones de cargue y descargue. No se le pueden asignar tareas diferentes e importantes proque se queda corto en la ejecuciÃƒÂ³n. ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(60, '2', '52', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'Willian es una persona de confianza y de buenos principios y lo hemos valorado por ello en planta, pero realmente es necesario hacer una evaluaciÃƒÂ³n muy crÃƒÂ­tica de los rendimientos que quedan muy por debajo del nivel de una persona que lleva 25 aÃƒÂ±os en la empresa. No nos ayuda a ser competitivos en el proceso y sus altos tiempos hacen que los estandares de producciÃƒÂ³n se nos suba y que no podamos cumplir las metas de manera individual y que lo resultados grupales no sean los mejores. ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(61, '2', '221', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'es un chico con el que se tenia muchas expectativas desde la entrevista porque es una persona decente y respetuosa, pero su dinamismo y eficiencia no se reflejan en el proceso, se ha hecho de manera individual y con el grupo de trabajo un proceso de concientizaciÃƒÂ³n acerca de mejorar los resultados, se ha tenia en la oficina de producciÃƒÂ³n hablando de rendimientos pero finalmente esto no se ve reflejado en los resultados, las programaciones con el nunca se cumplen y quedan y normalmente quedan por debajo de un 60% y obviamente esto no es ÃƒÂ³ptimo para los resultados que se requieren, no podemos dar mas tiempo de capacitaciÃƒÂ³n. ', 'NO', 'bg-success', '2023-06-22', '2023-06-22'),
(62, '2', '214', 'COMPLETADO', 'Viviana Maria Romero Acevedo', 'JEFE DE PRODUCCION', 'es una persona que hemos querido rescatar en el proceso pero si analizamos el tema de eficiencias no esta de acuerdo a los parametros exigidos para alcanzar las metas de producciÃƒÂ³n, no se le pueden asignar tareas complejas en tapizado no alcanza los tiempos de producciÃƒÂ³n. Tiene muchas ausencias por motivos diferentes los cuales afectan duramente los tiempos de producciÃƒÂ³n.', 'NO', 'bg-success', '2023-06-23', '2023-06-23'),
(63, '3', '258', 'COMPLETADO', 'Santiago Elias Murillo Henao', 'JEFE ADMINISTRADOR', 'Es una persona educada, comprometida, y responsable, sin embargo, le hace falta mÃƒÂ¡s dinamismo y anÃƒÂ¡lisis en sus diferentes funciones teniendo en cuenta que estÃƒÂ¡ en proceso de formaciÃƒÂ³n universitaria.\r\nSe le ha visto mejorÃƒÂ­a en la comunicaciÃƒÂ³n oportuna, las actividades que se le asignan las toma de la mejor forma, siempre es muy diligente.\r\nDebe de trabajar en ser mÃƒÂ¡s analÃƒÂ­tica, y tener iniciativa en su ÃƒÂ¡rea de trabajo.\r\n', 'SI', 'bg-success', '2023-07-04', '2023-07-04'),
(64, '3', '21', 'COMPLETADO', 'Diana Marcela Mora Cardona', 'JEFE DE DISENO Y CALIDAD', 'Tiene un buen desempeÃƒÂ±o en el proceso de diseÃƒÂ±o y desarrollo. Es una persona muy comprometida y con habilidades para el cargo de diseÃƒÂ±o.', 'SI', 'bg-success', '2023-08-04', '2023-08-04'),
(65, '4', '249', 'COMPLETADO', 'Jose Octavio  Arias Tabares', 'JEFE DE MANTENIMIENTO Y METROLOGIA', 'es muy activo en los estudios que ha realizado como la mecatrÃƒÂ³nica y electrÃƒÂ³nica para aplicarla en las actividades de la empresa', 'SI', 'bg-success', '2023-08-18', '2023-08-18'),
(66, '2', '250', 'COMPLETADO', 'Jhon Jaime Silva Ortiz ', 'LIDER DE TAPICERIA', 'Debe mejorar la relaciones con sus compaÃƒÂ±eras de trabajo. Ha avanzado en el conocimiento con el proceso de costura', 'SI', 'bg-success', '2023-08-18', '2023-08-18'),
