(69, '3', '82', 'COMPLETADO', 'Santiago Elias Murillo Henao', 'JEFE ADMINISTRADOR', 'Es una persona que fue promovida de operario de TapicerÃƒÂ­a a Auditor, es Juicioso, responsable, educado, y con muy buena actitud.\r\nA pesar del poco tiempo a aprendido las funciones de su cargo de manera adecuada, y toma las observaciones de manera muy receptiva.\r\nDebe de ser mÃƒÂ¡s activo en los inventarios, comunicar las novedades de sus funciones a su jefe inmediato, y evitar el uso de celular para temas personales.\r\n', 'SI', 'bg-success', '2023-09-13', '2023-09-13'),
