(75, '2', '327', 'COMPLETADO', 'Gustavo Adolfo Ortiz Perez', 'COORDINADOR DE PRODUCCION', 'Su ritmo de trabajo no es bueno , su actitud al momento de realizar las operaciones tampoco, muchas veces se le observa recostado en el puesto de trabajo lo cual no es una postura adecuada para un proceso productivo , ademÃƒÂ¡s de esto en el proceso de capacitaciÃƒÂ³n de empaque no demostraba mucho interÃƒÂ©s por aprender ya que en el momento de la explicaciÃƒÂ³n se concentraba en otras cosas por esta razÃƒÂ³n se reubica en otros procesos con el fin de evaluar sus habilidades y sacar su mÃƒÂ¡ximo potencial pero no se han obtenido los resultados esperados.', 'NO', 'bg-success', '2024-03-27', '2024-03-27'),
