(32, 'Denota buena actitud muy buena disponibilidad y deseo de superaciÃ³n', 16, 1),
(33, 'Entrevista preliminar conducente a la vinculaciÃ³n en el cargo solicitado esperando resultados de exÃ¡menes clÃ­nicos , teniendo en cuenta que supero satisfactoriamente las pruebas en fabrica.', 16, 1),
(34, 'AndrÃ©s Felipe es un muchacho que desde que iniciÃ³ la entrevista se ve poco agradable, con poco respeto hacia el entrevistador, su ultimo trabajo fue en Coats cadena y parece y le realizaron terminaciÃ³n de contrato en lo que percibo porque su forma de ser es conflictiva, dice que la empresa no lo valorÃ³ y que hay rosca en los grupos de trabajo, tambiÃ©n ha sido Uber. Finalmente cuando se le hablÃ³ de las actividades a a realizar dijo que no creÃ­a ser afÃ­n al proceso de lijado, que le fastidiaba la nariz con el polvo a pesar de no sufrir de rinitis.', 21, 6),
(35, 'es una persona que se mostro receptiva, ha estado en varias ocasiones en una misma empresa, este aÃ±o no ha estado vinculado a ninguna empresa- se le hablo sobre los horarios laborales- dice no tener problema si lo programan un sÃ¡bado- se le hablo sobre el manejo de permisos personales y mÃ©dicos en lo posible hacerlo fuera de los horarios laborales, se le hablo sobre el uso de los elementos de protecciÃ³n personal- se le hablo sobre la rotacion en planta segÃºn las necesidades de la empresa - con Gustavo Ortiz se le dio la vuelta a la planta pero se nota pasivo frente a los roles que deberÃ­a desempeÃ±ar en la planta - dice que si se podira adaptar a las condiciones laborales pero realmente no se ve una persona dinÃ¡mica y activa para trabajar bajos los tiempos de producciÃ³n requeridos ', 22, 6),
(39, 'pruebas sistemas', 23, 5),
(44, 'queda en estado elegible', 23, 1),
