(2181, 'El control de calidad para maquinado es el seguimiento detallado por cada maquina por donde pasa cada  producto en  donde cada operario y el lÃƒÂ­der deben velar el cumplimiento de las especificaciones de este,  apoyÃƒÂ¡ndose con las listas de chequeo.', '', '', '5', '2023-10-02', 846, 1379),
(2182, 'Se maneja (FO-PRD-22 INSPECCION DE PIEZAS EN MAQUINAS) (EP-PRD-01 ESPECIFICACIONES DE PRODUCTO MADERA)(EP-PRD-04 ESPECIFICACIONES DE PRODUCTO TAPICERIA)(PL-PRD-01 PLANOS TECNICOS DEL PRODUCTO) (PL-PRD-10 PLANOS TECNICOS DE BOCELES) Y ESPECIFICACIONES DE SIERRA VERTICAL', '', '', '5', '2023-10-02', 846, 1380),
(2183, 'El objetivo no es mantener un puesto de trabajo bonito , sino trabajar de forma mas eficiente, mejorando la calidad , se evitan confusiones y se detectan anomalÃƒÂ­as rÃƒÂ¡pidamente , se minimiza las averÃƒÂ­as e incidencias internas, ademÃƒÂ¡s  se obtiene mejoras en la prevenciÃƒÂ³n de riesgos laborales y aumenta la motivaciÃƒÂ³n al trabajar en un eterno mas agradable.', '', '', '5', '2023-10-02', 846, 1381),
(2184, 'El porcentaje de humedad de la madera debe ser aproximadamente del 15Ã‚Â° para poder que siga al proceso de transformaciÃƒÂ³n o a ensamble.', '', '', '5', '2023-10-02', 846, 1382),
(2185, 'No se debe dejar pasar producto mal maquinados que no cumplan con los planos tÃƒÂ©cnicos o especificaciones , melaminas despicadas o mal enchapadas , humedades  en las maderas  no mayores al 15 Ã‚Â°', '', '', '5', '2023-10-02', 846, 1383),
(2186, 'Los elementos de entrada y desarrollo se realiza mediante una investigaciÃƒÂ³n de productos en el mercado que cumplan o sean semejantes  a las exigencias y requisitos presentados por el comitÃƒÂ© Presidencial  y una vez se haya realizado dicha investigaciÃƒÂ³n y se tengan varias alternativas, la jefe de diseÃƒÂ±o y calidad  deberÃƒÂ¡ escoger una propuesta mas idÃƒÂ³nea y plasmar un diseÃƒÂ±o  para el desarrollo del nuevo producto con base a la investigaciÃƒÂ³n. ', '', '', '5', '2023-10-02', 844, 1317),
(2187, 'Cuando se tiene identificado y plasmado el diseÃƒÂ±o, se deberÃƒÂ¡ identificar y desglosar el producto diseÃƒÂ±ado, especificando las piezas y los parÃƒÂ¡metros para su construcciÃƒÂ³n, teniendo en cuenta el impacto y caracterÃƒÂ­sticas de trabajo en cada una de las secciones, tambiÃƒÂ©n se debe tener en cuenta sus propiedades y medidas ademÃƒÂ¡s los herrajes y los accesorios que tendrÃƒÂ¡ como componente el producto.', '', '', '5', '2023-10-02', 844, 1318),
(2188, 'Una vez se tenga el diseÃƒÂ±o con todas las especificaciones del producto se le informa al jefe de producto para que de inicio a la fabricaciÃƒÂ³n de la prueba piloto teniendo en cuenta ( PD-PRD-05 a PD-PRD-10) ', '', '', '5', '2023-10-02', 844, 1319);
