(68, 14, 'Es una persona con amplio conocimiento en el tema de aplicaciÃƒÂ³n y manejo de equipos , tiene buena tÃƒÂ©cnica de aplicaciÃƒÂ³n , no muÃƒÂ±equea y mantiene una buena linea secuencial al momento de trabajar una superficie grande a fin de que no le quede fogueado . El terminado del producto no fue el esperado ya que desde que empezÃƒÂ³ la prueba manifestÃƒÂ³ que la posiciÃƒÂ³n de la cubierta no era la adecuada para obtener un buen resultado , sin embargo con un solo retoque se pudo liberar la unidad.', 11),
