(74, 20, 'Se ve que tiene conocimiento del proceso ,hizo buenas sugerencias en cuanto al funcionamiento de la cabina y compartiÃƒÂ³ situaciones importantes de acuerdo a sus anteriores experiencias ,las cuales nos pueden ayudar a fortalecer algunas debilidades que tenemos en el proceso . ', 11),
(75, 21, 'SI', 11),
(121, 14, 'No tiene experiencia en el manejo de equipos de alta y por esta razÃƒÂ³n se le adecuo el equipo , este seria un punto a trabajar en caso de ser contratado pero no es una barrera ya que por la experiencia que tiene se puede acoplar fÃƒÂ¡cilmente a los equipos , tiene buena linea de aplicaciÃƒÂ³n , sabe manejar bien la pistola , no muÃƒÂ±equea , aplica  con buena distancia entre el pico de la pistola y el producto a pintar . \r\nSe reviso el producto y tiene un buen terminado ( sin fogueo , sin piel de naranja , solo se goteo la parte donde entra la cava pero no es visible  . En tÃƒÂ©rminos generales supero la prueba .', 15),
