(28, 'REALIZADO', 'bg-success', '5.6', '1.12', 'Se resalta en el que es una persona atenta que toma bien las instrucciones y asignaciones de actividades en la secciÃƒÂ³n, es responsable pero debe mejorar de una forma mas enfÃƒÂ¡tica la parte de tiempos en los procesos de producciÃƒÂ³n, es muy pasivo y poco dinÃƒÂ¡mico y es algo que debe tener para que los objetivos del proceso se cumplan a cabalidad. ', 'SUPERA LO ESPERADO', 1004681711, 0, 0, 26, 26),
(31, 'REALIZADO', 'bg-success', '4.3', '0.86', 'ninguna', 'CUMPLE CON LO ESPERADO', 1088039400, 0, 0, 193, 29),
(30, 'REALIZADO', 'bg-success', '6.3', '1.26', 'Ninguna', 'SUPERA LO ESPERADO', 1088039400, 0, 0, 193, 28),
(32, 'REALIZADO', 'bg-success', '4.6', '0.92', 'Es una persona educada, comprometida y responsable; en el proceso de costos se  le ha visto una gran mejorÃƒÂ­a, siempre es presto a escuchar las retroalimentaciones de su jefe inmediato, sin embargo es demasiado pasivo en los seguimiento correspondientes a sus funciones, debe de revisar herramientas que le ayuden a recordar los procesos que son esporÃƒÂ¡dicos, trabajar en ser mÃƒÂ¡s proactivo debido a que dilata mucho los procesos y mejorar la comunicaciÃƒÂ³n con la comunicaciÃƒÂ³n con los Jefes de la Fabrica, debe evitar suponer para evitar reprocesos.', 'CUMPLE CON LO ESPERADO', 1088017408, 0, 0, 9, 30),
(33, 'REALIZADO', 'bg-success', '4.8', '0.96', '', 'SUPERA LO ESPERADO', 1004681711, 0, 0, 52, 31),
