(41, 'REALIZADO', 'bg-success', '4.6', '0.92', 'Debe mejorar en proponer acciones para el mejoramiento continuo de los procesos frente a producto y metodologÃƒÂ­as de trabajo. Participar conjuntamente con los jefes de Procesos en la planeaciÃƒÂ³n estratÃƒÂ©gica y acciones de mejoras de la empresa a fin de lograr un mejoramiento continuo.', 'CUMPLE CON LO ESPERADO', 1087991335, 0, 0, 10, 33),
(42, 'REALIZADO', 'bg-success', '4.5', '0.9', 'German es una persona comprometida y organizada. Comunica activamente novedades acerca de la materia prima. Suministra informaciÃƒÂ³n confiable y oportuna.  La idea es fortalecer mas el proceso de liderazgo, manejo de equipos. Debe fortalecer mas aspectos del SGC como las inspecciones, el procedimiento de PNC y las biblias de producciÃƒÂ³n. ', 'CUMPLE CON LO ESPERADO', 42150928, 0, 0, 50, 34),
(43, 'REALIZADO', 'bg-success', '4.5', '0.9', 'Jaime Silva es un lÃƒÂ­der del proceso con orientaciÃƒÂ³n a resultados. Imparte disciplina y responbilidad en el trabajo. Es una persona con mucha ÃƒÂ©tica y amor a la empresa. Tiene excelentes ideas en pro de la mejora del proceso. Con el grupo de trabajo que direcciona se comunica asertivamente aunque en el trabajo en equipo con sus pares se le ha dificultado la comunicaciÃƒÂ³n. El trabajo bajo presiÃƒÂ³n lo estresa y puede actuar impulsivamente. ', 'CUMPLE CON LO ESPERADO', 42150928, 0, 0, 62, 35),
(44, 'REALIZADO', 'bg-success', '4.7', '0.94', 'Gustavo es un lÃƒÂ­der de proceso empoderado de sus funciones, con conocimiento pleno en el proceso de producciÃƒÂ³n, con experiencia en la fabricaciÃƒÂ³n de producto y asignaciÃƒÂ³n de tareas segÃƒÂºn los recursos disponibles. Cuenta con empatÃƒÂ­a y tiene una visiÃƒÂ³n general del proceso. Debemos pensar en documentar mas el proceso soportar el conocimiento en capacitaciones de Nexus y trabajar mas al dÃƒÂ­a con el SGC. Participa activamente en planes de mejora.', 'CUMPLE CON LO ESPERADO', 42150928, 0, 0, 7, 36),
